import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with load state instead of networkidle
    await page.goto(fileUrl, { waitUntil: 'load' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for critical elements to be present
    await page.waitForSelector('#searchInput');
    await page.waitForSelector('.search-btn');

    // Extract data from script variables using evaluate
    const extractedData = await page.evaluate(() => {
      const data = {};

      try {
        // Extract all available data objects from script
        if (typeof window.junProfile !== 'undefined') data.junProfile = window.junProfile;
        if (typeof window.products !== 'undefined') data.products = window.products;
        if (typeof window.junProducts !== 'undefined') data.junProducts = window.junProducts;
        if (typeof window.junReviews !== 'undefined') data.junReviews = window.junReviews;
        if (typeof window.allProducts !== 'undefined') data.allProducts = window.allProducts;
        if (typeof window.cart !== 'undefined') data.cart = window.cart;
        if (typeof window.wishlist !== 'undefined') data.wishlist = window.wishlist;
        if (typeof window.orderHistory !== 'undefined') data.orderHistory = window.orderHistory;
        if (typeof window.searchHistory !== 'undefined') data.searchHistory = window.searchHistory;
        if (typeof window.recentlyViewed !== 'undefined') data.recentlyViewed = window.recentlyViewed;
      } catch (e) {
        console.error('Error extracting data:', e);
      }

      return data;
    });

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Successfully extracted bulk data including user profile, products, reviews, cart, wishlist, order history, search history, and recently viewed items",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data exfiltration simulation",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
